import React from "react";

const Plan = (props) => {
  const wishlistDisplay = props.wishlist.map((want) => {
    return <li>{want}</li>;
  });
  return (
    <div>
      <div>
        Your wishlist
        <ul>
          <li></li>
        </ul>
      </div>
    </div>
  );
};

export default Plan;
